import Section1 from './Section1'
import Section2 from './Section2'
import React from 'react';

function LandingPage(){

    window.addEventListener('scroll', onScroll);
    function onScroll(){
        const section1 = document.getElementById('section2');
        const section2 = document.getElementById('section1');

        if(section2.offsetHeight+section1.offsetHeight <= window.innerHeight + window.scrollY){
            document.get('firstList').style.display = 'flex';
        }
    }

    return(
        <>
            <Section1 />
            <Section2 />
        </>
    )
}

export default LandingPage;
